import React from 'react';
import tachyons from 'tachyons';
import Tilt from 'react-tilt';
const Logo = () => {
	return(
		<div className='ma4 mt0'>
			<Tilt className="Tilt" options={{ max : 40 }} style={{ height: 250, width: 250 }} >
 				<img src="logo.jpg"/>
			</Tilt>
		</div>
	)
}
export default Logo;
